import React, { useState } from "react";
import './sponsors.css';
import Button from '@mui/material/Button';
import Modal from '@mui/material/Modal';
import Box from '@mui/material/Box';

function Sponsors() {
    const [open, setOpen] = useState(false);
    const handleOpen = () => setOpen(true);
    const handleClose = () => setOpen(false);

    const styleButton = {
        marginLeft: 20,
        padding: 4,
        fontSize: 'large',
        bgcolor: 'rgb(218, 198, 236)',
        borderRadius: 5,
        fontColor: 'red',
    }

    return (
        <div className="sponsors__main-container">
            <h1 className="sponsors__title">COLABORATORI</h1>
            <div className="sponsors__buttons">
                <Button sx={styleButton} onClick={handleOpen}> La Butoaie</Button>
                <Modal
                    open={open}
                    onClose={handleClose}
                >
                    <Box className="sponsors__box">
                        ceva
                    </Box>
                </Modal>
            </div>
        </div>
    );
}

export default Sponsors;
